var $  = require( 'jquery' );

class HomeOne extends Component {
  componentDidMount() {
    $(function(){
        alert('hi');
    });
}
render() {
    return (
        <div className="wrapper">
            <table ref="main" />
        </div>);
}
}

export default HomeOne;
